    [63577] = {
        id = 63577,
        text = "1.一心复仇的鸢一折纸，在时崎狂三的帮助下回到过去，发现杀死父母的凶手竟然就是自己……无尽的绝望泯灭了理智，灵结晶反转，[救世魔王]临世，她的意识中只留下了杀戮与毁灭。\n2.反转折纸的破坏，让天宫市陷入空前的危机之中，我们需要集结全服勇士，收集[绝望之羽]，唤醒折纸的心智！——完成[唤醒作战行动]中的各种任务挑战，获取更多的绝望之羽吧！\n3.即使再小的贡献，也能有巨大的改变。每当全服「绝望之羽」的收集进度提高一个阶段，会解锁一个阶段奖励，同时会解锁「记忆约会」中更多的约会。\n4.[记忆约会]就像联系所有星辰的轨道，我们利用Ratatoskr开发的特殊装置，穿梭在所有与折纸的美好回忆中，收集每一个约会中的[记忆碎片]，将它们组合成完整的记忆拼图，就能让黑暗中徘徊的折纸醒来！",
