    [63578] = {
        id = 63578,
        text = "跨越时空，与你重逢——\n        这里是折纸的回忆世界形成的空间，简称「回忆空间」。这个空间的时间线相当不稳定。你需要在这个空间中探索，完成不同的任务并解锁「回忆约会」，进入约会中找到折纸。\n        进入回忆约会后无法中途退出，完成或是退出约会都将发生记忆中断，无法再重新进入约会。请务必在约会中慎重做出选择。\n        每个「回忆约会」中，都隐藏了一个记忆碎片。收集所有的记忆碎片，将解锁最终的约会。\n\n时间线跳跃：\n        Ratatoskr开发了特殊的装置，可以用来收集回忆空间中的能量。\n        消耗一定的能量可以跳跃时间线，从当前回忆中脱离，进入一个新的回忆。\n        跳跃时间线时，会出现一个新的「回忆约会」，之前的回忆约会将无法再被重新定位，请务必完成了约会之后再进行时间跳跃。",
