    [63586] = {
        id = 63586,
        text = "在宝石铸造中，誓约者们可以使用材料合成A-SS级宝石或者S-SS级的图纸。    \n\n  在铸造时需要先选择想要铸造的宝石品质再选择精灵最后选择技能后才可以进行铸造。    \n\n  选择不同的宝石品质铸造所消耗的材料不同，同时选择是否随机精灵与是否随机技能也会影响材料消耗的数量。",
