        text = "给予美九重新站上舞台的信心，拿着她能感受到所有观众的支持。",
    },
    [63587] = {
        id = 63587,
        text = "1.指挥作战系统40级开放，玩家达到相应等级满足条件可对关卡派遣出战，派遣出战可获取收益\n2.【精灵星级】：1星精灵战力达到：1000   2星精灵战力达到：2000  3星精灵战力达到：3000（战力未计算质点、宝石和信物）\n3.【精灵羁绊】已上阵精灵可形成羁绊，获得收益加成\n4.【其它】主角经验不享受指挥作战星级加成和羁绊加成",
    },
    [42084] = {
        id = 42084,
        text = "A级能量宝石，获取后可随机得到【八舞夕弦】任意技能A级宝石。（获得后自动使用）",
    },
    [63588] = {
        id = 63588,
        text = "1.【关卡派遣】关卡满足相应条件后，玩家指挥精灵进行派遣\n2.【推荐星级】派遣精灵总星级达到推荐星级可获得100%出战奖励，星级加成规则具体如下：\n出战精灵总星级             获得收益百分比\n1星                                  30%\n2星                                  70%\n3星                                  100%\n4星                                  113%\n5星                                  123%\n6星                                  131%\n7星                                  138%\n8星                                  144% \n9星                                  150%\n3.【行动力消耗】每个精灵每派遣1min，需消耗1点行动力\n4.【立即完成】立即完成按照每分钟消耗2钻石计算当前关卡总消耗\n5.【连续派遣】满足消耗情况下，完成当前关卡派遣，默认进入下一关卡派遣\n6.【收益计算】基础收益*星级加成+基础收益*羁绊加成+羁绊额外奖励\n7.联机作战派遣次数为奖励次数\n8.雷霆圣堂派遣无法获得正常挑战首通奖励\n9.点击关卡处黄色标记，可取消当前关卡派遣",
