        text = "1.【精灵羁绊】已上阵精灵可形成羁绊，获得收益加成\n2.【精灵行动力】每个精灵行动力上限相同，每次派遣成功需要消耗行动力，行动力每10min恢复1点，达到上限后不再恢复\n3.【精灵星级】：1星精灵战力达到：1000   2星精灵战力达到：2000  3星精灵战力达到：3000（战力未计算质点、宝石和信物）\n4.【精灵上阵】精灵星级达到1星，才可上阵派遣",
