        text = "1. 请针对目前回答有错的问题优先进行训练\n2. 目前回答非常优秀的问题，如果您训练了会审核失败哦~\n3. 切记：十香AI的回答绝对不能出现政治色彩！坚决不能涉及色情！否则不但会审核失败还会扣你的训练师经验哦！\n4. 十香AI的回答最好能够符合她本身的性格，当然要是回答得非常有趣也可，否则审核也是不会让你通过的~嘻嘻\n5. 最容易通过审核的训练当然非‘日常聊天会谈论的话题’莫属了，正确做法是: 建议和十香AI日常聊天，这样发现十香AI回答得不对再进行训练，通过率会非常高哟！\n6. 如果是刻意找一些‘无意义的问题或者一些名词解释’对十香AI进行训练，劝你善良哦~这些通通都不会通过审核的，重复刷训练内容是非常有可能被扣训练官经验的！\n7. 训练官们如果不明白为什么总是审核失败，想要提高通过率的可以咨询可爱的客服找到训练组织哦~",
