    },
    [14210210] = {
        id = 14210210,
        text = "        世上最可怕的事不是自我的沉沦，而是被遗忘在无尽的虚空，溺水者的垂下的双手，将会被谁紧握？",
    },
    [14210209] = {
        id = 14210209,
        text = "        为了让流星般的美好停留多一秒，为了让真情付出不至于无声消散，集合众精灵的力量，她斩下救赎的长剑。",
    },
    [14210208] = {
        id = 14210208,
        text = "        赌运是世上最捉摸不透的事物，就像时间长河中的相遇，被称为奇迹，而我愿为你创造这样的奇迹。",
    },
    [272116] = {
        id = 272116,
        text = "备战关卡挑战次数达到240次",
    },
    [14210207] = {
        id = 14210207,
        text = "        所谓厚积薄发，不过是在结果达成之后的称赞。但是有时候是这样，会不自觉地想要称赞那些真实的努力家。",
    },
    [14210206] = {
        id = 14210206,
        text = "        就算世界沦陷，就算忘却过去，就算魔影倾轧，心中永远有一个身影，鼓励着妳前进、变强。",
    },
