        text = "击杀追猎计划boss3个",
    },
    [14210204] = {
        id = 14210204,
        text = "        休息时间到。但是梦想是不会休息的！下一次的集结，就要挑战下一个最高峰！",
    },
    [14210203] = {
        id = 14210203,
        text = "        人有时候会想着要变成另一个人。但其实，只要愿意付诸努力与时间，总会有所改变的。",
    },
    [14210202] = {
        id = 14210202,
        text = "        人生总要经历很多「裁决」。即使不是轻小说的主角，也勇敢的去面对吧！",
    },
