    [14210163] = {
        id = 14210163,
        text = "亲爱的誓约者：\n        Ratatoskr检测到鸢一折纸的心情值急速下降，即将反转，原因不明，现场情况十分危急。请准备好前往查探，注意保护自身安全。\n                                努力把折纸画好看的大凉山制作组",
    },
    [272133] = {
        id = 272133,
        text = "预留任务",
    },
    [14210162] = {
        id = 14210162,
        text = "亲爱的誓约者：\n        Ratatoskr再次检测到强烈的灵力波动，经过分析，灵力参数和万由里吻合度极高！\n        Ratatoskr全体注意，启动最高紧急预警备案，准备迎接强敌。\n        万由里~是你回来了吗？\n                                某不愿意透露姓名的策划D·A·L",
    },
    [14210161] = {
        id = 14210161,
        text = "亲爱的誓约者：\n        由于七罪提供最新变形技术，十香的聊天AI-“傻香”正式加入了Ratatoskr陪大家聊天解闷。\n        大凉山一直在努力营造良好的游戏氛围，积极尝试更多更新更好的企划，接下来还会有新的精灵加入到日常聊天中，请大家敬请期待！\n                                大凉山制作组",
    },
    [14210160] = {
        id = 14210160,
        text = "亲爱的誓约者：\n        又一位充满魅力的爱豆即将和大家见面啦！同时，大家的老婆万由里配音也实装啦~想听万由里说点什么呢？\n        由于之前声优排期的问题，配音未能和版本同时上线，大家都有些许遗憾，但大凉山绝不会偷工减料！\n        大凉山会不断努力，为大家带来更优质的内容。虽然可能会迟到，但是绝不会缺席。\n                                          大凉山制作组",
    },
    [272134] = {
        id = 272134,
        text = "社团成员在指令中活跃度达到20000",
    },
    [14210159] = {
        id = 14210159,
        text = "亲爱的誓约者：\n        由于大凉山制作基地遭遇强烈的空间震，导致开发服务器间歇性宕机，严重影响了开发工作，导致服务器开服延迟，对此我们深表歉意，并且会吸取教训，避免后续出现类似的情况，感谢大家支持\n                                大凉山制作组",
    },
    [30322] = {
        id = 30322,
        text = "识别名为“隐居者”，几乎不敢与人直接对话，平时由另一人格四糸奈通过手上的兔子与外界对话。",
    },
    [14210158] = {
        id = 14210158,
        text = "亲爱的誓约者：\n        近期检测到黑色球体突然降临于天宫市上空。\n        经过Ratatoskr分析，精灵们互相之间的嫉妒、独占欲等负面感情，逐渐聚合形成了黑色球体。\n        从黑色球体中检测到强烈的灵力波动，疑似空间震预兆，请各位誓约者做好作战准备！\n                                大凉山制作组",
    },
