    [12010146] = {
        id = 12010146,
        text = "1.玩家等级达到40级开启四糸乃剧场挑战，领略她们跌宕起伏的剧情故事和激情澎湃的战斗关卡。\n2.剧场玩法主要包涵：约会关卡、战斗关卡。\n3.您在约会中的选择，将会直接影响剧情的发展，是享受更多甜蜜约会还是陷入无尽战斗，现在开始抉择吧！",
