    [14110080] = {
        id = 14110080,
        text = "9.若开启副本的玩家在战斗中掉线，必须等待队员挑战完该副本后，才能参加符石挑战。",
    },
    [14110079] = {
        id = 14110079,
        text = "8.开启符石挑战的玩家，和参与符石挑战的玩家，在奖励上有一定区别。",
    },
    [14110078] = {
        id = 14110078,
        text = "7.以队长身份开启符石挑战的玩家，没有次数限制，只要拥有道具即可开启。",
    },
    [14110077] = {
        id = 14110077,
        text = "6.以队员身份参与符石挑战的玩家，获取奖励有一定的次数限制。",
    },
    [14110076] = {
        id = 14110076,
        text = "5.每个符石挑战副本拥有时间限制，超过对应的时间，副本则自动消失。",
