    [14110075] = {
        id = 14110075,
        text = "4.符石副本挑战成功后，该副本自动消失。",
    },
    [14110074] = {
        id = 14110074,
        text = "3.玩家需要道具【挑战符石】，才能开启对应的副本。道具可以通过夏拉姆商店，抽奖中获取。",
    },
    [14110073] = {
        id = 14110073,
        text = "2.符石挑战分为D,C,B,A,S五个不同的等级，等级越高，挑战难度越大，但是奖励更好。",
    },
    [14110072] = {
