    [12010147] = {
        id = 12010147,
        text = "1.每周一早上10:00到周日晚上22:00，全服将会开启雷霆圣堂挑战。\n2.玩家每次攻打雷霆圣堂，都会产生一定的贡献值，它们将汇聚到全服总贡献值之中，当全服总贡献达到一定进度时，雷霆圣堂将提升难度。\n3.每隔8个小时将获得1次挑战机会，挑战中的表现，将影响您的个人伤害奖励、个人贡献奖励、全服贡献奖励等。\n4.个人伤害奖励的计算规则为：每次挑战造成的伤害越高，将获得更高的贡献值（最高100点）\n5.个人贡献奖励的计算规则为：根据每次挑战获得的贡献值高低与雷霆圣堂的难度，将会在战斗结算时折算为不同数量的金币、灵波聚合物等。\n6.全服贡献奖励的计算规则为：全服总贡献值达到一定进度，将会激活全服宝箱，在每个进度达成之前，若你参与过挑战，就可以在周日22:00-23:30结算期间领取宝箱奖励（未领取的奖励将通过邮件发放）。\n7.另外，每个难度的雷霆圣堂在第一次挑战时，将会获得首通奖励，每个难度雷霆圣堂仅限一次（每个难度的雷霆圣堂首通奖励不同）",
    },
    [14110068] = {
        id = 14110068,
        text = "3.关卡中需要【队长】带领队员前进，通过不同的房间，进入最终挑战房间，通过关卡，才算作战斗胜利。",
    },
    [14110067] = {
