    },
    [13400194] = {
        id = 13400194,
        text = "对于女仆工作非常细致的少女，希望将一切打理得井然有序，但那只是期望……",
    },
    [13400193] = {
        id = 13400193,
        text = "能够统筹一切的店长级女仆，常常给其他女仆安排工作，偶尔也会有撒娇的时候。",
    },
    [13400192] = {
