    [13310525] = {
        id = 13310525,
        text = "亲爱的誓约者：\n        由于我们卡池设置了保护机制，平衡欧非之间的差距，并且没有在规则中明确告知，导致大家对我们产生了一些质疑，对于给大家造成了困扰和误会我们深感抱歉。\n        虽然我们在游戏中考虑了诸多友好的设计，但是因为考虑不周全，实施不及时，规则不透明等问题，并没有得到预期的反馈，大凉山制作组作为一个新的团队，需要不断地学习，不断地成长，不断地完善游戏内容，感谢大家长久以来的包容和支持！\n                                                                大凉山制作组",
    },
