    [63042] = {
        id = 63042,
        text = "嘉年华活动攻略——「你已经准备好了吗？」\n本次活动包含3个小游戏以及抽奖活动。\n\n「幸运轮盘」游戏规则：\n        1. 下注上限为50幸运币；\n        2. 结算：轮盘停止的位置对应的精灵即为获胜，会按倍率返还该精灵的下注幸运币数量。其他精灵的下注则算作输给了七罪，不会返还。\n\n「占卜」游戏规则：\n        七罪会使用三张卡片来进行占卜。七罪翻转所有卡片后，你只要找到七罪的真身，就会获得好运（误），并按倍率返还幸运币；\n\n「幸运骰子」游戏规则：\n        1. 可以选择「美九」/「琴里」/「?×3」单独下注。「?×3」可以和「美九」或「琴里」搭配下注，「美九」和「琴里」不能同时进行下注；\n        2. 结算：转动骰子停止后，若出现「音符」更多，则算「美九」获胜；若出现「火苗」更多，则算「琴里」获胜；若出现任意三个相同的面，则算作「？」获胜（同时也算作转到的更多面的精灵获胜）；\n----------------------------------\n抽奖活动规则：\n        1. 抽奖活动可使用活动专属道具「幸运徽记」进行抽奖；\n        2. 「幸运徽记」可在商店「嘉年华」中进行兑换；\n        3. 「抽奖活动」共有两个奖池。在一阶段轮盘中获得最上层的道具，即可解锁二阶段。\n        4. 两个阶段的奖池中，奖品的数量都是有限的，奖励全部获得后，将不再能够继续抽奖。\n「抽奖活动」为参与者们准备了最终大奖「七罪·Lucky Queen 高级时装」，不要错过哦~\n-----------------------\n抽奖活动概率公示———\n一阶段：       \n        七罪普通看板    0.50%\n        S级图卷自选箱  4.00%\n        A级宝石自选箱  4.00%\n        A级随机宝石     10.50%\n        S级随机图纸     10.50%\n        命运徽章           10.50%\n        金币福袋           15.00%\n        经验福袋           15.00%\n        本源福袋           15.00%\n        质点精华福袋   15.00%\n二阶段：       \n        七罪高级看板       0.50%\n        SS级图卷自选箱   4.00%\n        S级宝石自选箱     4.00%\n        A级宝石自选箱  10.50%\n        S级图卷自选箱   10.50%\n        A级挑战书           10.50%\n        金币大福袋          15.00%\n        经验大福袋          15.00%\n        本源大福袋          15.00%\n        质点精华大福袋 15.00%",
    },
