    [63037] = {
        id = 63037,
        text = "        活动期间，派遣女仆在女仆咖啡厅中营业可获得营业额增长。\n       当营业额达到指定数值时可获得奖励。\n       收集女仆、提升营业额能够解锁咖啡厅的故事剧情。\n       初始默认会有3个固定的女仆帮助您营业，当活动开启后进入活动时女仆咖啡厅便开始营业了。\n       玩家获得爱心蛋包饭后，可使用爱心蛋包饭可在女仆咖啡厅中招募女仆。\n       女仆分为三个品质，且拥有不同的体力，揽客，料理能力值。\n       女仆在营业期间会消耗体力，休息期间逐渐恢复体力。\n       女仆的揽客能力值越高，客人数量会越多。\n       女仆的料理能力值越高，客人消费会越多。\n       派遣拥有羁绊加成的女仆可以激活羁绊。\n       派遣的女仆体力为0，则该女仆将停止服务哟，同时也不会触发相应的羁绊。",
