    [62999] = {
        id = 62999,
        text = "2.订阅价格及周期\n您可以在游戏中订阅「自动续费月卡」，订阅价格为$3.99，订阅周期为30天。\n\n3.关于订阅内容\n订阅「自动续费月卡」的使用者可在订阅周期内获得特权体验，特权内容为:\n①订阅即可立刻获得300钻石，每天获得60钻石，持续30天\n②连续签到可获得月卡币，月卡币可免费兑换月卡专属礼包。\n\n4.关于自动续订\n苹果AppStore官方订阅功能为自动续费订阅，由iTunes Account进行确认支付，用户需手动在iTunes/Apple ID设置管理中关闭自动续订功能。订阅自动续费将于每个订阅周期结束前的24小时之内进行扣费,并由iTunesAccount进行确认支付。如果需要取消订阅功能，您需要于订阅结束前至少24小时关闭自动续费功能。如果在此时间之前未能取消自动续费，则订阅周期会自动延续。\n\n5.取消订阅流程\n如果您想取消订阅，请在您的iOS设备上前往“设置”->选择“iTunes Store与App Store”->点击“AppleID”，接下来选择“查看AppleID”,进入“账户设置”，点击“订阅”->“管理”，并选择“约战：精灵再临”对应的订阅，之后便可取消订阅。",
    },
