    [63001] = {
        id = 63001,
        text = "        在这里你可以查看游戏中目前拥有的全部角色的基础信息。通过活动左侧的角色头像列表，可以切换不同的角色。\n        界面右侧的六芒星阵图代表着该角色在游戏中的一般定位，上方的战斗力代表了当前角色的强度，战斗力可以通过提升角色等级、提升稀有度、强化天使或装备质点等方式增加。\n        左侧稀有度下方的攻略按钮可以查看该角色具体的技能介绍，对了解角色的技能有很大帮助。点击下方的练习按钮，则会进入独特的练习模式。\n        点击角色半身像立绘或右侧的详细按钮，可以进入该角色的各个成长模块界面，强化角色的属性、技能或更换灵装等。\n        天使突破：精灵培养至60级，品质达到EX后，可开启天使突破，天使突破可获得天使点。",
