        text = "        装备质点可以为持有角色增加属性和额外效果。\n        质点的属性包括主属性和随机属性两种。主属性为生命、攻击、防御，随着质点等级的增加而增加。随机属性为质点获得时直接生成的属性，根据质点品质，最多有4条随机属性。\n        额外效果包括质点附加技能、质点组合技能和质点套装技能3种。每种质点都拥有唯一独特的附加技能；装备2个以上质点时，如果有两个质点在卡巴拉之树中处于相邻位置，则会激活组合技能，卡巴拉之树可以通过点击【组合】按钮进行查看。当同一角色装备的3个质点为同一套装，且能激活3个组合属性时，该套装的套装技能将被激活。\n        此外，质点还拥有更换、强化、洗练、改造和升星5个主要功能，相关内容将在对应界面进行介绍。",
    },
