    [10403118] = {
        id = 10403118,
        text = "每击杀1个目标，狂三攻击力+1%，最高叠加20层，持续20秒。",
    },
    [10403116] = {
        id = 10403116,
        text = "战斗中，狂三时间值上限+50点，且每秒额外恢复2点时间值。",
    },
    [10403115] = {
        id = 10403115,
        text = "当狂三受到致命伤害时，将不会死亡并立即恢复自身20%的最大生命值，但是需要消耗50点时间值，若时间值不足，则失败。",
    },
    [10403114] = {
        id = 10403114,
        text = "[食时领域]持续时间延长5秒。\n[[食时领域]期间，狂三攻击力+15%，附带5%的吸血，且每2秒获得每个敌人1点时间值，每次使用食时领域时，会对场上所有敌人附加1层食时腐蚀，最多5层，狂三对拥有食时腐蚀的敌人，每层提升3%的伤害。]",
    },
    [10403113] = {
        id = 10403113,
        text = "狂三暴击目标时，将使[食时领域]冷却时间-1秒，此效果每3.5秒最多触发1次。",
    },
    [10403112] = {
        id = 10403112,
        text = "[食时领域]开启后将使领域内的敌人静止5s。",
    },
    [63005] = {
        id = 63005,
        text = "        回收功能可以让已经强化、改造之后的质点重置为初始状态，并返还之前消耗的材料（洗练质点消耗的材料不会返还）。\n        质点回收分为免费回收和完全回收2种方式。免费回收不消耗任何道具，但只会返还30%的强化材料；完全回收会返还全部强化材料，但需要根据质点的当前等级消耗一定的钻石。\n        此外，在进行质点洗练、出售等消耗质点的操作时，均会自动执行免费回收。",
    },
    [10403111] = {
        id = 10403111,
        text = "[食时领域]期间，命中目标时，将有10%的几率触发减速、减防、眩晕、点燃、感电中的一种效果。",
    },
    [10403110] = {
        id = 10403110,
        text = "当目标处于减益状态时，狂三对其造成的技能伤害+20%。",
