    [3004102] = {
        id = 3004102,
        text = "1.质点世界由空间枢纽组成，控制空舰移动可以解锁更多区域，通过传送点可以前往世界内的不同空间枢纽\n2.净化任务分多个阶段，依次完成后，终极恶魔现身，击败恶魔后成功净化质点世界\n3.质点世界中还有各种特殊事件，产出各种奖励，注意查看地图说明\n4.触发事件会消耗能源点数，能源点数会自动恢复，也可通过莉莉子商店兑换道具补给\n5.在质点世界中作战，精灵会受邪恶力量污染，带有特殊buff标志的精灵作战时会额外增加感染度，感染度过高时不能编入队伍\n6.地图中的非任务类事件每天会刷新，注意“事件统计”中的刷新时间\n7.探索目标只会在探索成功后出现，注意观察雷达信号的变化，方可探索成功\n8.点击右下角雷达，可以使用任务目标定位功能，随机获得一个当前阶段任务目标位置",
    },
