    [63019] = {
        id = 63019,
        text = "        游戏中的副本包括以下几类：\n剧情副本\n        剧情副本以约战的主线故事为大纲，用约会关卡和战斗关卡的显示还原整个约战的剧情，关卡中有丰富的剧情、CG和配音等。\n        剧情副本分为多个章节，章节直接有相应的解锁关系，同时剧情副本还是突破道具、角色碎片的主要产出地，想要自己喜爱的角色更为强大的话，多多挑战剧情副本吧。\n日常副本\n        和剧情副本不同，日常副本的战斗更为丰富，甚至包括飞行模式和跑酷模式等新奇玩法。\n        日常副本的开放具有一定的限制，所有日常副本会在一周中循环开启和关闭，请注意开放时间噢~\n活动副本\n        相比剧情副本和日常副本普遍简单的难度来说，活动副本的难度要高得多，是真正检验角色的强弱和你的操作的活动玩法。活动副本包括如同天梯的无尽模式；考验操作的精灵试炼；有趣的多人联机；神秘的卡巴拉作战等。",
    },
