        text = "「幸运骰子」游戏规则：\n1. 骰子：游戏中将使用三枚特殊骰子。每个骰子的六面，有三面是代表「美九」的「音符」，另外三面是代表「琴里」的「火苗」；\n2. 下注：选择中间精灵的头像即可进行下注。骰子游戏中，「美九」和「琴里」不能同时进行下注，但可以和中间的「？」一起下注。\n3. 结算：转动骰子停止后，若出现「音符」更多，则算「美九」获胜；若出现「火苗」更多，则算「琴里」获胜；若出现任意三个相同的面，则算作「？」获胜（同时也算作转到的个面的获胜）；获胜的精灵，将按赔率返还下注的幸运币；",
