        id = 63049,
        text = "中秋节活动攻略：\n又到了吃货的节日了！「知秋之夜」活动攻略分以下4个部分：\n\n1. 收集食材\n        在游戏的各个角落里可以收集节日限定掉落的食材，详细可以查看掉落活动的说明。\n\n2. 制作月饼\n        集齐食材后便可以制作月饼。菜单上有三种月饼，分别是：豆沙蛋黄月饼、果香冰皮月饼、五仁香酥月饼。\n\n3. 提交月饼\n        提交月饼，完成任务，解锁中秋节限定约会与CG。\n\n4. 月饼兑换\n        制作多余的月饼可以用来兑换包括中秋节限定头像、头像框、徽章等丰厚奖励哟~",
