        text = "1.完成时间线索任务，可获得时间催化剂。消耗一份时间催化剂，可以翻开一张时间秘宝。已打开的秘宝不会再翻回背面。\n\n2.打开两份相同的时间秘宝后，即可获得秘宝中的奖励以及时间秘宝碎片。\n\n3.时间秘宝碎片可以在活动商店中兑换其他道具。\n\n4.打开所有时间秘宝后，即会将所有秘宝重置，进入下一轮奖励。",
