        text = "部分随机道具的获取概率如下：\n\n精华礼盒\n        道具                  数量                概率\n    理解精华              5-8                 13.5%\n    仁爱精华              5-8                 13.5%\n    严格精华              5-8                 13.5%\n    光辉精华              5-8                 13.5%\n    基础精华              5-8                 13.5%\n    王国精华              5-8                 13.5%\n    魔术师精华          6-10                19%  \n\n    誓约者们可以通过充值购买商店街代币后再前往商店街购买礼包，使用商店街代币购买礼包时可以使用打折扣卷。\n\n    折扣卷分为日常折扣卷与通用折扣卷，部分礼包只能使用通用折扣卷才能进行打折。\n\n    充值购买商店街代币会计入累计充值以及充值活动的额度，但使用商店街代币购买礼包时则不会增加累计充值与充值活动的进度。",
