    [62068] = {
        id = 62068,
        text = "        灵力容器的裁决者-万由里，突然降临天宫市，精灵们原本被封印的灵力开始变得不稳定，向外溢出的灵波使得周围的物品沾染上了微弱的灵力。\n\n        天宫市的守护者需要在与精灵约会的过程中收集沾染上灵力的“物品“-可能是食物、礼物等。部分特殊的物品作为与精灵约会的见证，可能成为守护精灵的“信物”，从而被收集并珍藏。\n\n        “信物”可以被携带在人或者精灵身上，使得佩戴者有更强的力量，部分特殊“信物”之间可能会存在一定的关联，产生不可思议的联合效果。特定“信物“可能会对某些人或者精灵有灵力相关的倾向，从而在佩戴时激活特定的效果。\n\n        “信物”等级强化：收集灵波聚合体以及其它具备特殊能量的强化材料可以用于增强“信物”的等级，从而提高信物的属性。\n\n        “信物”品阶提升：使用特定的进阶材料可以提升满级信物的品阶，从而提高信物等级上限以及更多的属性，达到品阶上限后则不可继续提升。",
    },
