    [3310011] = {
        id = 3310011,
        text = "11.社团荣誉与社团竞赛排名关联，为一些活动限定奖励，作为后期规划内容，敬请期待",
    },
    [3310010] = {
        id = 3310010,
        text = "10.作战排名分为社团内个人追猎排名和各社团竞赛排名。个人追猎积分为社团成员当前周期所有对Boss造成的伤害转换后的积分；当前周期内社团挑战Boss进度（最高Boss等级，造成伤害）设置社团竞赛排行榜，下一周期展示上一周期社团竞赛排名数据",
    },
    [3310009] = {
        id = 3310009,
        text = "9.作战奖励分为Boss首通奖励和击杀奖励。首次击杀Boss可以拿到首通奖励，在下一周期备战阶段开启前均可领取，未领取的首通奖励不会补发；本周期结束后会对社团挑战Boss等级进行结算，社团成员可以获得最高等级Boss及向下2级内的Boss击杀奖励，在下一周期挑战阶段开启前均可领取，未领取的击杀奖励不会补发",
    },
    [300113] = {
        id = 300113,
        text = "活动作战",
    },
    [3310008] = {
        id = 3310008,
        text = "8.队伍人数为1~5人，根据Boss等级，组队人数要求限制不同，同时会获得对应人数的队伍增益",
    },
    [3310006] = {
        id = 3310006,
        text = "6.社团Boss战斗属性和总血量值会随等级提升而提升，以及多个队伍同时在挑战Boss，因此每个队伍战斗完后总血量结算显示上均有差异",
    },
    [3310004] = {
        id = 3310004,
        text = "4.每个弱点副本对应一项社团Boss的战斗属性（分别为生命上限、攻击力、防御力），成功挑战次数越多，进入挑战期后Boss的战斗属性削弱效果越明显（生命上限削弱效果对社团Boss总血量一样生效）。弱点副本中作战失败也可以获得奖励，但是不会统计该弱点副本的成功挑战次数",
    },
    [3310001] = {
        id = 3310001,
        text = "1.追猎计划在社团等级4级时开启，加入社团时间超过48小时且社团基础贡献度到达200的成员可参与此活动",
