        text = "雪人工坊未领取奖励",
    },
    [2130516] = {
        id = 2130516,
        text = "1.每名玩家每日00:00自动刷新3个关卡，点击关卡图标可以创建房间。关卡完成后不能重复挑战。\n\n2.可以使用钻石立即刷新关卡，需要注意：刷新时未挑战的关卡将消失。每日刷新次数有限。\n\n3.活动关卡可以通过组队大厅进行组队，援助其他玩家关卡可获得同等关卡奖励。\n\n4.每日援助次数有限，且逾期不会累计。请务必在当日使用。\n\n5.12月29日之后，有新的关卡加入到随机刷新序列，新的关卡中将掉落雪人改造材料“齿轮”。\n\n6.1月3日之后，有新的关卡加入到随机刷新序列，新的关卡中将掉落雪人改造材料“螺丝”。",
    },
    [2130515] = {
