        id = 2130514,
        text = "1.圣诞大作战：\n      完成精灵委托任务，最终会收到精灵赠送的圣诞礼物！可获得雪球、2019圣诞质点、2019圣诞专属CG！\n\n2.雪人大作战：\n      圣诞节到了，今年和雪人们一起打雪仗！ 可组队完成雪人挑战，收集材料提升雪人工厂的技能。可获得大量雪球，兑换圣诞头像、圣诞头像框、圣诞信物等丰厚的圣诞纪念品！\n\n3.圣诞应援：\n      在活动期间，通过礼包币和付费方式在补给站的“新手推荐”、“热卖”、“活动限时”、“养成基金”中购买的礼包，可累积全服进度。达到指定数量时，领取丰厚返利大礼~",
