    [1500002] = {
        id = 1500002,
        text = "尊敬的各位玩家：\n\n夜刀神十香：【终于和大家见面啦！】\n时崎狂三：【啊啦啊啦~真的见面了呢，贵安哦。感谢大家一直以来对我们的期待，初次见面还请多多指教。】\n鸢一折纸：【作为《约会大作战》角川正版授权手游，主创团队一直致力于给玩家带来一款专业且精致的纯正二次元手游。】\n夜刀神十香：【唔姆~本次测试是首次面向广大玩家的删档测试，所以其中有些不足的地方，还请见谅啦~（程序员妹妹哭晕在厕所T-T）。在之前的测试中，玩家们提出了很多问题及建议，我们都有认真的收集和整理哒。同时……针对性的调整计划也已经列出了哦，等我们下一次约会就可以看到啦。】\n五河琴里：【关于游戏BGM、精灵形象、战斗内容、游戏玩法等在测试阶段玩家较为关注的问题，Ratatoskr也在持续的进行完善，请大家放心。】\n夜刀神十香：【一定会有原班CV配音！】\n鸢一折纸：【一定会有原班CV配音！】\n五河琴里：【一定会有原班CV配音！】\n时崎狂三：【如果您在游戏过程中遇到任何问题或者您对我们游戏有着更高的期许，烦请加入本次删档测试交流群：542524583，与广大的约战粉丝以及我们团队一起让《约战》变得更加优秀。】\n鸢一折纸：【再次感谢您的支持，这是我们前进最大的动力。】\n夜刀神十香：【现在——开始我们的战争（约会）吧！】\n\nPS：测试期间福利满满，记得每天来发掘哦~~\n\n测试期间遇到任何问题，请联系客服QQ：4000585151",
    },
