    [63002] = {
        id = 63002,
        text = "        角色的成长模块分为属性、结晶、质点、天使、羁绊、宝石、和灵装7个模块\n\n属性\n        属性界面将展示角色当前的基础属性和通过结晶、质点、羁绊等直接增加的属性之和（不含技能提供的属性）。可以通过右下方的升级按钮，使用经验卡道具为角色升级，从而增加大量基础属性。\n\n结晶\n        结晶可以直接增加角色的基础属性。角色的结晶一共有7个阶段，和角色稀有度相对应。每个阶段有若干个结晶格子，消耗材料可以进行结晶突破，点亮对应的结晶格子并获得属性加成。\n\n质点\n        角色可以通过装备质点获得属性加成和特殊技能，一个角色最多可同时装备3个不同类型的质点。根据质点的所属类型和所属套装，还可以激活质点组合技能和套装技能。需要注意的是，装备质点需要消耗cost，越强力的质点，所消耗的cost越高。\n\n天使\n        天使系统将全面强化角色的各个技能，通过消耗升级获得的天使技能点数，可以扩展角色的普通攻击、一般技能、必杀技等技能的段数、伤害和额外效果。同时对天使进行觉醒后，还可以自由携带16个备选被动技能中的4个；精灵培养至70级，品质达到EX后，可开启天使突破，天使突破可获得天使点。\n\n羁绊\n 装备通过约会获得的信物后可以激活羁绊，羁绊将为角色提供属性加成和额外效果。信物本身也可以通过强化材料进行升级和进阶，升级和进阶后将提供属性加成的效果。\n\n宝石\n 装备宝石可以大幅度强化角色技能，宝石分为7个稀有度，收集低级宝石可以合成为高级宝石，高级宝石除强化技能伤害外，还拥有独特的额外效果。\n\n灵装\n        更换不同的灵装，会改变角色在战斗中的皮肤效果。高级别的灵装除了改变角色的战斗皮肤外，还会有独特的动作、全新的技能特效音效、专属的技能图标等。",
    },
