        text = "欢迎来到天宫市，在这里和心仪的精灵们展开约会吧！\n\n1.点击左侧的精灵头像框，可以选择想要进行约会的精灵哦。\n\n2.约会玩法的主要功能有：好感度约会、日常约会、精灵互动和小游戏玩法。\n\n3.好感度约会：您可以点击头像弹出菜单中的“主线”按钮，弹出约会界面。\n\n4.好感度约会界面中展示了本次约会可能获得的CG，还可以预览“结局礼盒”中的信物，以及“好感度礼盒”中的丰厚奖励，达到任务要求后，请及时前来领取哦~\n\n5.点击好感度约会界面中的“前往约会”，即可开启梦幻的约会之旅，好感度约会每日不限次数，但需要消耗一定的精力哦~\n\n6.日常约会：您可以点击头像弹出菜单中的“日常”按钮，弹出约会界面。\n\n7.日常约会界面中展示了即将前往约会的场景，还可以预览“结局礼盒”中的信物，以及所有结局的收集进度。\n        点击日常约会界面中的“前往约会”，即可开启梦幻的约会之旅，日常约会每天可进行3次，之后需要消耗约会券解锁最多2次约会。\n        除去好感度约会和日常约会外，请多多观察精灵的情绪变化，头像上会显示“饥饿、生气、无聊”等状态，请及时与她们约会哦~\n\n8.当精灵头像显示“饥饿”，则可以通过头像弹出菜单中的“观察”按钮找到精灵，并且点击精灵进行食物赠送。",
    },
