    [63028] = {
        id = 63028,
        text = "想要让心仪的精灵穿上最可爱的衣服时刻出现在自己眼前吗？\n\n1.在看板娘展示界面，您可以自由更换各个精灵的不同服装状态，作为主页的看板娘哦。\n\n2.在左侧的看板娘头像列表中，选中已解锁的精灵头像，点击右侧的“确认更换”就能更换看板娘了。\n\n3.在更换之前，您还可以点击“换装”、“信息”、“动作”三个标签来查看精灵的预览效果。\n\n4.“换装”标签页：在这里您可以拖动精灵服装卡片，查看该精灵所有服装的上身效果。\n\n5.“信息”标签页：在这里您可以查看该精灵的基本信息和简介，其中包括女孩子的私密信息哦！\n\n6.“动作”标签页：在这里您可以预览触碰精灵时产生的回馈，好感度没达到的话，就只能看台词了~\n\n7.另外，界面中所有的“未解锁”内容，都是可以点击查看的，来为您的“提前攻略”寻找参考吧！\n-------------------------------------------\n\n轮换播放功能现已上线！\n\n现在可以选择多位精灵、多套服装（仅限高级时装）作为看板了。轮播模式处于开启状态时，每隔一段时间，主界面会自动切换到下一位看板那里。",
    },
