    [63036] = {
        id = 63036,
        text = "        装备宝石可以强化角色的技能，宝石拥有基础效果和额外效果。基础效果通常为增加对应技能的伤害，宝石稀有度越高，基础效果的数值强度越大。宝石稀有度达到S以上时，会根据稀有度获得1-3个额外效果，额外效果将对所属技能产生影响，如减少技能冷却时间，附加额外伤害等。\n        宝石的额外效果并不是固定的，和质点的随机属性类似，在获得宝石时，额外效果将从一定范围的技能池中进行随机，装备拥有额外效果的宝石后，在天使界面会激活对应的技能效果。宝石拥有所属角色和所属技能栏位的属性，即宝石只能装备到对应角色的对应技能槽上。",
