    [63043] = {
        id = 63043,
        text = "「幸运轮盘」游戏规则：\n1. 下注：选择中间精灵的头像即可进行下注。轮盘游戏中可以对所有精灵下注，下注上限为50幸运币；\n2. 结算：轮盘停止的位置对应的精灵即为获胜，会按倍率返还该精灵的下注幸运币数量。其他精灵的下注则算作输给了了七罪，不会返还。",
