    },
    [62020] = {
        id = 62020,
        text = "召唤分为萌新召唤、热点召唤、友情召唤、精准召唤和限定召唤5种不同的类型：\n\n萌新召唤\n消耗命运徽章召唤质点和精灵，召唤池范围巨大，但不包括一些极其稀有的最新质点或精灵。拥有保底机制，10次召唤中必然出现A级及A级以上精灵或5星质点。\n萌新召唤期间，稀有角色和质点的出货概率会大大增加，累计进行60次萌新召唤之后，还可以领取任意S级角色。\n需要注意的是，萌新召唤只会在创建召唤后的7天内出现\n\n热点召唤\n在热点召唤中，角色和质点会以轮换的方式在每期之间的变化，每期会有一个热点角色和热点质点套装大大增加出货概率。\n和萌新召唤类似，热点召唤也拥有保底机制，10次召唤必然出现A级及以上角色或5星质点。热点角色中，如果在80次之内都未获得S级以上角色，会在80次召唤时获得随机S级角色，且有极大概率是本期热点角色。\n热点质点中，如果50次之内都未获得5星套装质点，会在50次召唤时获得随机套装质点，且极大概率是本期热点质点之一。此机制中的召唤次数在每期切换时会予以保留，不会被清空。\n(注意：如果抽到S角色或者五星套装质点，则累计抽取次数会重置）\n\n友情召唤\n消耗友情点进行召唤，召唤池范围较小，无法获得稀有质点和精灵，且没有保底机制。\n\n精准召唤\n消耗命运徽章召唤质点或精灵，召唤池相比萌新召唤和热点召唤要小，通常分为精准质点和精准精灵2种类型。每期均拥有主题质点或精灵，主题质点和主题精灵的召唤概率要高于其他召唤池的相同物品，且拥有主题质点兑换和主题精灵次数奖励功能。\n\n限定召唤\n消耗誓约之证进行召唤，主题质点或精灵均为极其稀有的等级，且即使限定召唤结束后也不会加入到其他召唤池中。",
    },
    [63039] = {
        id = 63039,
        text = "        5星套装质点（活动的套装质点除外）强化到一定等级后，可以进行升星，获得属性加成、等级上限增加和新随机属性等提升。\n\n        升星分为3个阶段——5星+、5星++、6星，每个阶段需要的升星材料和获得的升星效果均不同。除消耗基本的金币、道具、质点精华外，升星还需要消耗规定类型和规定星级的质点。\n\n        需要注意的是，升星之后，质点不再能作为消耗材料参与质点兑换、质点强化、质点洗练，也不能进行出售。",
    },
