    [63040] = {
        id = 63040,
        text = "端午节活动攻略：\n说道端午节，当然就是包粽子啦！本次活动包含以下4个部分的内容——\n\n1. 收集食材\n        在游戏的各个角落里可以收集节日限定掉落的食材，详细可以查看掉落活动的说明。\n\n2. 制作粽子\n        集齐食材后便可以制作粽子。菜单上有三种粽子，分别是：五谷粽子、鲜肉粽子、豆沙粽子。\n\n3. 提交粽子\n        提交粽子，完成任务，解锁端午节限定约会与CG。\n\n4. 粽子兑换\n        制作多余的粽子可以用来兑换包括端午节限定头像、头像框、徽章等丰厚奖励哟~",
